import React from "react";
import "./style.css";
import Tab from "react-bootstrap/Tab";
import Tabs from "react-bootstrap/Tabs";
import ContactsList from "../contacts-list";

const TabsSection = () => {
    return (
        <React.Fragment>
            <div className="col-sm-12 tabs">
                <Tabs defaultActiveKey="Chat">
                    <Tab eventKey="Chat" className="chat-tab" title="پیام ها">
                        <ContactsList/>
                    </Tab>
                    <Tab eventKey="Call Log" title="تماس ها">
                        <p>
                            Where art thou Muse that thou forgehy pen both skill and
                            argument. Rise, resty Muse, my love's sweet face survey, If Time
                            have any wrinkle graven there;
                        </p>
                    </Tab>

                    <Tab eventKey="Missed Calls" title="مخاطبین"></Tab>
                </Tabs>
            </div>
        </React.Fragment>
    )
}


export default TabsSection;
